import React from "react";
import { Row, Col } from "react-flexbox-grid";
import "./about.scss";
// Components
import TeamBox from './teamBox';
import TeamInfo from "./teamInfo";
import Title from "../ui-components/title/title";
// Assets
import Person01 from "../../assets/about/person01.png";
import Person02 from "../../assets/about/person02.png";

const about = () => (
  <div id="about">
    <div className="wrapper">
      <Title title="ABOUT US." />
      <p className="font12">
        We are a team with a Visions and dedication toward our work and responsibilities.<br></br>Which always gives best to deliver best.
      </p>
      <Row>
      <Col md={12} lg={4}>
          <TeamBox avatar={Person02} name="Pawan Dhull" job="Mobile Application Developer" />
        </Col>
        <Col md={12} lg={4}>
          <TeamBox avatar={Person01} name="Rishab Sethi" job="Web designer" />
        </Col>
        <Col md={12} lg={4}>
          <TeamBox avatar={Person01} name="Ajay Sheokand" job="Web Developer" />
        </Col>
        <Col md={12} lg={4}>
          <TeamBox avatar={Person02} name="Abhishek Chouhan" job="Android Developer" />
        </Col>
        <Col md={12} lg={4}>
          <TeamBox avatar={Person02} name="Jayant Pahuja" job="React Native Developer" />
        </Col>
        <Col md={12} lg={4}>
          <TeamInfo />
        </Col>
      </Row>
    </div>
  </div>
);

export default about;
